import React from "react";


function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <div className="card">
        <div className="top">
          <h2 className="name" >Beyonce</h2>
          <img
            className="circle-img"
            src="https://mblogthumb-phinf.pstatic.net/MjAxNzAyMjBfMTE4/MDAxNDg3NTIzMjAwOTY2.ZS6p4LvpuWjejm8RG3hWLGJuvrD__StKUBcM8D_q83Qg.glPSu48IGhcEVTZetcWPvfz-FT-TG7I5INN0zcMUSR4g.JPEG.ghdud1641/KakaoTalk_20170220_000729923.jpg?type=w800"
            alt="avatar_img"
          />
        </div>
        <div className="bottom">
          <p>+123 456 789</p>
          <p>b@beyonce.com</p>
        </div>
      </div>
    </div>
  );
}

export default App;
